import { View, Text, TouchableOpacity } from "react-native";
import React from "react";

const DishRow = ({ id, name, description, image, price }) => {
  return (
    <TouchableOpacity>
      <View>
        <Text>{name}</Text>
        <Text>{description}</Text>
      </View>
    </TouchableOpacity>
  );
};

export default DishRow;
